// Helper functions to access voices
function getVoicesByLanguage(service, language) {
    const langCode = language.toLowerCase();
    const serviceVoices = COMPREHENSIVE_VOICES[service.toLowerCase()];
    return serviceVoices && serviceVoices[langCode] ? serviceVoices[langCode] : [];
}

function getAllVoicesForService(service) {
    const serviceVoices = COMPREHENSIVE_VOICES[service.toLowerCase()];
    if (!serviceVoices) return [];
    
    let allVoices = [];
    for (const langCode in serviceVoices) {
        allVoices = allVoices.concat(serviceVoices[langCode]);
    }
    return allVoices;
}

function getAvailableLanguages(service) {
    const serviceVoices = COMPREHENSIVE_VOICES[service.toLowerCase()];
    return serviceVoices ? Object.keys(serviceVoices) : [];
}

// Export for Node.js environments
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        COMPREHENSIVE_VOICES,
        getVoicesByLanguage,
        getAllVoicesForService,
        getAvailableLanguages
    };
}